import React from 'react'
import { 
    LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip,
} from 'recharts';
// import { Row , Col } from 'reactstrap'
import { ScheduleComponent, Day, Week, WorkWeek, Month, Agenda, Inject } from '@syncfusion/ej2-react-schedule';

import {CommonCard} from '../../components/cards/CommonCard'


//example data
const data = [{name: 'Page A', uv: 400, pv: 2400, amt: 2400},
{name: 'Page B', uv: 200, pv: 2400, amt: 2400},
{name: 'Page C', uv: 400, pv: 2400, amt: 2400},
{name: 'Page D', uv: 400, pv: 2400, amt: 2400}, ];

const data2 = [{name: 'Group A', value: 400}, {name: 'Group B', value: 300},
            {name: 'Group C', value: 300}, {name: 'Group D', value: 200},
            {name: 'Group E', value: 278}, {name: 'Group F', value: 189}]

export default function Home() {
    return (
        <div>
            <CommonCard width={"100%"}>
            <LineChart width={600} height={300} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
                <Line type="monotone" dataKey="uv" stroke="#8884d8" />
                <CartesianGrid stroke="#ccc" strokeDasharray="5 5" />
                <XAxis dataKey="name" />
                <YAxis />
                <Tooltip />
            </LineChart>
            </CommonCard>

            <ScheduleComponent height='550px' selectedDate= {new Date(2018, 1, 15)} eventSettings={ { dataSource: data2 } } >
            </ScheduleComponent>
            
        </div>
    )
}
